import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { DvCalculator, NameSplitter } from './screens';

const styles = {
  buttonGroup: {
    display: "flex",
    width: "100%",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "red"
  },
  button: {

  },
}

ReactDOM.render(
  <React.StrictMode>
      <div className="header" />
      <div style={styles.buttonGroup}>
        <button style={styles.button}>Calculadora de DV</button>
        <button style={styles.button}>Split de nombres</button>
      </div>
    <DvCalculator />
  </React.StrictMode>,
  document.getElementById('root')
);
